import React from "react";

const TransactionDetails = ({state, onChange}) => {

    const handleIdInputChange = (e) => {
        onChange({transactionId: e.target.value})
    }

    const handleOrderNumberChange = (e) => {
        onChange({orderNumber: e.target.value})
    }
    return <>
        <h1>Szczegóły transakcji</h1>

        <label>
            ID Transakcji
            <input onChange={handleIdInputChange} value={state.data.transactionId}/>
        </label>


        <label>
            Numer zamówienia
            <input onChange={handleOrderNumberChange} value={state.data.orderNumber}/>
        </label>

    </>
}

export default TransactionDetails
